import './Expense.css';
import ExpenseItem from './ExpenseItem'
function Expense(props)
{

    return (
        <ExpenseItem
        title={props.title[0].title}
        date={props.title[0].date}
        amount={props.title[0].amount}
        ></ExpenseItem>
    )
}
export default Expense
